export class AbstractPresenter {
  constructor(v) {
    this.view = v;
  }

  start(singleWidgetContainer, initial, data) {
    throw new TypeError("AbstractPresenter's start must be called from child class");
  }

  isSingleTon() {
    return true;
  }

  isHistory() {
    return true;
  }

  mayLeave() {
    return true;
  }

  close() {}
}
